class Solution:
    def checkSubarraySum(self, nums, k: int) -> bool:
        seen = {}
        seen[0] = -1
        preSum = 0
        for i, n in enumerate(nums):
            preSum += n
            exp = preSum // k
            if preSum - (exp * k) in seen:
                if (i - seen[preSum - exp * k] >= 2):
                    return True
            
            if preSum - (exp * k) not in seen:
                seen[preSum - (exp * k)] = i
        # print(seen)
        return False

